-- Volcando estructura para tabla y_code.stock_control
DROP TABLE IF EXISTS `stock_control`;
CREATE TABLE IF NOT EXISTS `stock_control` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `product_id` bigint(20) NOT NULL,
  `invoice_id` bigint(20) DEFAULT NULL,
  `point_of_sale_id` smallint(6) NOT NULL,
  `tax_sale_id` smallint(6) NOT NULL,
  `tax_bill_id` smallint(6) NOT NULL,
  `batch` varchar(50) DEFAULT NULL,
  `fabrication_date` date DEFAULT NULL,
  `expiration_date` date DEFAULT NULL,
  `entry_date` date DEFAULT NULL COMMENT 'Fecha de entrada',
  `description` varchar(250) DEFAULT '',
  `unit_cost` decimal(30,4) NOT NULL DEFAULT 0.0000,
  `entries` decimal(30,4) NOT NULL DEFAULT 0.0000 COMMENT 'Entradas',
  `freight` decimal(15,4) NOT NULL DEFAULT 0.0000,
  `outputs` decimal(30,4) NOT NULL DEFAULT 0.0000 COMMENT 'Salidas',
  `stock` decimal(30,4) NOT NULL DEFAULT 0.0000,
  `timestamp` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `batch` (`batch`),
  KEY `product_id` (`product_id`),
  KEY `point_of_sale_id` (`point_of_sale_id`),
  KEY `invoice_id` (`invoice_id`),
  KEY `tax_bill_id` (`tax_bill_id`),
  KEY `tax_sale_id` (`tax_sale_id`) USING BTREE,
  CONSTRAINT `FK_stock_control_branch_offices` FOREIGN KEY (`point_of_sale_id`) REFERENCES `branch_offices` (`id`) ON UPDATE CASCADE,
